import { useSelector } from "../../CustomStore/hooks/useSelector"

export const Cart = () => {
  const cart = useSelector((state) => state.cart || {});

  return (
    <div>
      <div>Cart</div>
      {
        Object.keys(cart).map ((key)=> (
        <div>
          <span>{key}</span>
          <span>{cart[key]}</span>
        </div>
      ))}
    </div>
  )
}
